/*
    Plik:               CartBtn.js
    Funkcja:            PRZYCISK KOSZYKA W BANERZE APLIKACJI
    Opis:               Przekierowuje do konteneru Cart,js (koszyka). Pokazuje bieżącą sumę zamówienia.
    Elementy:           Suma zamówienia {props.total},
    Przykład użycia:    <ArtCard imagename={nazwa_zdjecia} name={nazwa_artykulu} description={opis artykulu} price={cena} />
    Dodatkowe info:     {nazwa_zdjecia} ma korespondowac z numerem artykulu w bazie danych
*/

import React from 'react';
import "./CartBtn.scss";
import carticon from '../../images/icons/black_cart.png';

const cartbtn = (props) => {
    return(
        <button className="CartBtn">
            <img className="carticon" src={carticon} alt="cart"/>
            {props.total} PLN
        </button>
    )
}

export default cartbtn
